const t=JSON.parse('{"key":"v-419604c0","path":"/posts/post-177-2012-11-28.html","title":"【台北士林】聖人橋上風櫃嘴、頂山、石梯嶺、擎天崗下冷水坑","lang":"zh-Hant-tw","frontmatter":{"lang":"zh-Hant-tw","title":"【台北士林】聖人橋上風櫃嘴、頂山、石梯嶺、擎天崗下冷水坑","date":"2012-11-28T00:00:00.000Z","category":["台北上山走走"],"description":"風櫃嘴至擎天崗，是陽明山東西大縱走的東段，步道沿著石板鋪成的石階和道路，一路經過芒草原、矮灌木、松樹林、牛路、大草原，是秋末健行賞芒的好去處。頂山，海拔768公尺，山頂一片草原，視野良好，為陽明山東西大縱走之第一座山。石梯嶺，海拔864公尺，山頂視野極佳，可欣賞陽明群山，山腰有片大草原，適合休憩。","sidebar":false,"sitemap.priority":0.8,"cover":"https://1013399.github.io/image-3/177/241924737_l.jpg","head":[["link",{"rel":"alternate","hreflang":"zh-tw","href":"https://1013399.github.io/posts/post-177-2012-11-28.html"}],["meta",{"property":"og:url","content":"https://1013399.github.io/posts/post-177-2012-11-28.html"}],["meta",{"property":"og:site_name","content":"101上山走走"}],["meta",{"property":"og:title","content":"【台北士林】聖人橋上風櫃嘴、頂山、石梯嶺、擎天崗下冷水坑"}],["meta",{"property":"og:description","content":"風櫃嘴至擎天崗，是陽明山東西大縱走的東段，步道沿著石板鋪成的石階和道路，一路經過芒草原、矮灌木、松樹林、牛路、大草原，是秋末健行賞芒的好去處。頂山，海拔768公尺，山頂一片草原，視野良好，為陽明山東西大縱走之第一座山。石梯嶺，海拔864公尺，山頂視野極佳，可欣賞陽明群山，山腰有片大草原，適合休憩。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:image","content":"https://1013399.github.io/image-3/177/241924737_l.jpg"}],["meta",{"property":"og:locale","content":"zh-Hant-tw"}],["meta",{"property":"og:locale:alternate","content":"zh-TW"}],["meta",{"property":"og:updated_time","content":"2024-01-16T08:04:47.000Z"}],["meta",{"name":"twitter:card","content":"summary_large_image"}],["meta",{"name":"twitter:image:alt","content":"【台北士林】聖人橋上風櫃嘴、頂山、石梯嶺、擎天崗下冷水坑"}],["meta",{"property":"article:author","content":"101上山走走"}],["meta",{"property":"article:published_time","content":"2012-11-28T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2024-01-16T08:04:47.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"【台北士林】聖人橋上風櫃嘴、頂山、石梯嶺、擎天崗下冷水坑\\",\\"image\\":[\\"https://1013399.github.io/image-3/177/241924737_l.jpg\\"],\\"datePublished\\":\\"2012-11-28T00:00:00.000Z\\",\\"dateModified\\":\\"2024-01-16T08:04:47.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"101上山走走\\",\\"url\\":\\"/intro.html\\"}]}"]]},"headers":[{"level":2,"title":"行車路線","slug":"行車路線","link":"#行車路線","children":[]},{"level":2,"title":"走走路線","slug":"走走路線","link":"#走走路線","children":[]},{"level":2,"title":"走走資訊","slug":"走走資訊","link":"#走走資訊","children":[]},{"level":2,"title":"參考地圖","slug":"參考地圖","link":"#參考地圖","children":[{"level":3,"title":"聖人橋至擎天崗","slug":"聖人橋至擎天崗","link":"#聖人橋至擎天崗","children":[]},{"level":3,"title":"擎天崗至冷水坑","slug":"擎天崗至冷水坑","link":"#擎天崗至冷水坑","children":[]}]}],"git":{"createdTime":1685380145000,"updatedTime":1705392287000,"contributors":[{"name":"陳依琳","email":"im1010ioio@gmail.com","commits":7}]},"readingTime":{"minutes":8,"words":2400},"filePathRelative":"posts/post-177-2012-11-28.md","localizedDate":"November 28, 2012","excerpt":"<p><strong>風櫃嘴</strong>至<strong>擎天崗</strong>，是陽明山東西大縱走的東段，步道沿著石板鋪成的石階和道路，一路經過芒草原、矮灌木、松樹林、牛路、大草原，景色變化萬千、峰迴路轉，是秋末健行賞芒的好去處。</p>\\n<p><strong>頂山</strong>，海拔768公尺，山頂一片草原，視野良好，有顆三等三角點No.1033及瑪蕃溪水源保護區界08號水泥基石，另有陽明山國家公園「足印草山」拓牌之足字，為陽明山東西大縱走之第一座山。</p>\\n<p><strong>石梯嶺</strong>，海拔864公尺，有顆保林基石No.18，原有之陽明山國家公園「足印草山」拓牌之印字已不見，山頂視野極佳，可欣賞陽明群山，山腰有片大草原，適合休憩。</p>\\n<p><strong>擎天崗東峰</strong>，又稱陽明山農場，海拔791公尺，山頂右側草叢旁有顆台灣省政府精密導線點基石，視野廣闊，可遠望七星山、小觀音山、竹篙山及金山地區。</p>\\n"}');export{t as data};
